drop table if exists BOOK;

create table Book (
	id INT auto_increment,
	isbn VARCHAR(50),
	book_title VARCHAR(255),
	author VARCHAR(50),
	genre VARCHAR(100),
	publication_date DATE,
	publisher VARCHAR(50),
	page_count INT,
	language VARCHAR(80),
	format VARCHAR(21),
	avail_format VARCHAR(17),
	price DECIMAL(5,2),
	rating DECIMAL(3,1),
	book_cover VARCHAR(255),
    primary key (id)
);
